  const handleToggle = () => {
    setToggle(!toggle);
  };
  
  return <><div className={style.modal_img}><img 
    onClick={handleToggle} className={clsx(style.img,{[style.img_active]:toggle})} src="./assets/v.png" alt="" />
  <div className={clsx(style.modal,{[style.modal_active]:toggle})}></div>
  </div></>;
};
